/**
 * @template {any} T
 */
export default class List<T extends unknown> {
    /** @type {T[]} */
    list: T[];
    isSetByUser: boolean;
    /**
     * @param {T[]} list
     * @param {boolean=} isSetByUser
     * @returns {this}
     */
    setList(list: T[], isSetByUser?: boolean | undefined): this;
    /**
     * @returns {boolean}
     */
    get isEmpty(): boolean;
    /**
     * @returns {number}
     */
    get length(): number;
}
